import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchDogs } from "../../store/actions";

export default function Dogs() {
  let dog = useSelector((state) => state.dogs);
  let dispatch = useDispatch();
  useEffect(() => {
    dispatch(fetchDogs());
  }, []);
  return (
    <div>
      {dog.data.foreach((dog) => {
        <div>
          <div>Name: {dog.name}</div>
          <div>Height: {dog.height}</div>
          <div>Weight: {dog.weight}</div>
          <div>Years: {dog.years}</div>
          <div>Image: {dog.image}</div>
          <div>Temperaments: {dog.temperament}</div>
        </div>;
      })}
    </div>
  );
}
